(13, 'Vietnam loses $2.5 billion over oil price collapse', 'ietnam-loses-25-billion-over-oil-price-collapse', '<p style="margin-bottom: 0px; padding: 7px 0px; border: 0px; outline: 0px; font-size: 15px; vertical-align: baseline; color: rgb(51, 51, 51); line-height: 22px; font-family: Arial, Helvetica, sans-serif; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;">123456</p><p style="margin-bottom: 0px; padding: 7px 0px; border: 0px; outline: 0px; font-size: 15px; vertical-align: baseline; color: rgb(51, 51, 51); line-height: 22px; font-family: Arial, Helvetica, sans-serif; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;"><img src="data:image/jpeg;base64," style="width: 237px;"><br></p>', '       \r\n                \r\n                \r\n                \r\n                \r\n                \r\n                \r\n                \r\n                \r\n                \r\n                \r\n                \r\n                \r\n                ', '/images/pages/2y10DsJaWWrsoEtHmTk1b7axuIYjyivYl5D1RSqDLodu7WRGGglK.png', 29, 'en', '2015-08-25 02:56:38', '2015-08-24 19:56:38', NULL),
(14, 'The collapse of oil prices will affect the Vietnamese economy i', 'The-collapse-of', '<p style="margin-bottom: 0px; padding: 7px 0px; border: 0px; outline: 0px; font-size: 15px; vertical-align: baseline; color: rgb(51, 51, 51); line-height: 22px; font-family: Arial, Helvetica, sans-serif; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;">The collapse of oil prices will affect the Vietnamese economy in both positive and negative ways, according to analysts.</p><p style="margin-bottom: 0px; padding: 7px 0px; border: 0px; outline: 0px; font-size: 15px; vertical-align: baseline; color: rgb(51, 51, 51); line-height: 22px; font-family: Arial, Helvetica, sans-serif; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;">The country’s oil and gas behemoth, PetroVietnam (PVN), said the oil price fall has left negative impacts on its operations and business results in this year’s first half.</p><p style="margin-bottom: 0px; padding: 7px 0px; border: 0px; outline: 0px; font-size: 15px; vertical-align: baseline; color: rgb(51, 51, 51); line-height: 22px; font-family: Arial, Helvetica, sans-serif; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;">But PVN will have to “consider many issues and monitor market development” to decide whether it has to cut oil exploration capacity, a company’s executive said when contacted by <em style="margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent;">Tuoi Tre</em> (Youth) newspaper on Friday.</p><p style="margin-bottom: 0px; padding: 7px 0px; border: 0px; outline: 0px; font-size: 15px; vertical-align: baseline; color: rgb(51, 51, 51); line-height: 22px; font-family: Arial, Helvetica, sans-serif; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;">The state-run oil and gas giant has been tasked by the government with exploring 16.8 million metric tons of crude oil in 2015, and has produced 9.2 million metric tons in the first six months of the year.</p><p style="margin-bottom: 0px; padding: 7px 0px; border: 0px; outline: 0px; font-size: 15px; vertical-align: baseline; color: rgb(51, 51, 51); line-height: 22px; font-family: Arial, Helvetica, sans-serif; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;">But the low oil prices have indeed taken a toll on many of PVN’s subsidiaries.</p>', '', NULL, 30, 'en', '2015-08-22 20:08:19', '2015-08-22 20:08:19', NULL);
