INSERT INTO `post_content` (`_id`, `title`, `slug`, `content`, `description`, `url`, `post_id`, `lang_id`, `created_at`, `updated_at`, `deleted_at`) VALUES
(16, '12211', '2121212', '<p style="font-family: Arial, Helvetica, sans-serif; font-size: 12px; color: rgb(0, 0, 0); line-height: normal; text-align: justify;">Với lực lượng vượt trội, dù phải làm khách nhưng <strong>Real</strong> sớm chiếm lĩnh thế trận. Dù vậy, hàng công của Real đã thi đấu khá bế tắc trước lối chơi kỉ luật của đội chủ nhà Gijon. Trong suốt hiệp 1,<a class="TextlinkBaiviet" href="http://www.24h.com.vn/su-kien/ronaldo/" style="color: rgb(0, 0, 255);">Ronaldo</a> và các đồng đội tung ra được rất nhiều cú sút nhưng đều không thành công.</p><p style="font-family: Arial, Helvetica, sans-serif; font-size: 12px; color: rgb(0, 0, 0); line-height: normal; text-align: justify;">Trong khi đó, Gijon trung thành với lối chơi phòng ngự phản công suýt chút nữa đã có bàn thắng, nếu như cú đánh đầu của Guerrero ở phút 36 không dội xà ngang.</p><p align="center" style="font-family: Arial, Helvetica, sans-serif; font-size: 12px; color: rgb(0, 0, 0); line-height: normal;"><span class="img-share" align="center" style="position: relative; display: block;"><span id="shareImage-0" class="shareImage" style="display: block; height: 20px; position: absolute; left: 25px; bottom: 10px; opacity: 0;"><img src="http://24h-static.24hstatic.com/images/2014/share-fb.gif" width="67" height="20" alt="" style="max-width: 400px;"> <span title=""><img src="http://24h-static.24hstatic.com/images/2014/share-gg.gif" width="67" height="20" alt="" style="max-width: 400px;"></span></span><img class="news-image" id="news-image-id-0" alt="Gijon – Real: Dấu ấn chiến thuật - 1" src="http://24h-img.24hstatic.com/upload/3-2015/images/2015-08-24/1440361971-bong-da-real.jpg" style="max-width: 400px;"></span></p><p style="font-family: Arial, Helvetica, sans-serif; font-size: 12px; line-height: normal; color: rgb(0, 0, 255); font-style: italic; text-align: center;">Bale (trái) đã không thể giúp Real có được bàn thắng</p><p style="font-family: Arial, Helvetica, sans-serif; font-size: 12px; color: rgb(0, 0, 0); line-height: normal; text-align: justify;">Hiệp 2 tiếp tục là kịch bản của hiệp 1. Real dồn toàn lực lên tấn công, còn Gijon chơi lăn xả và bọc lót tốt cho nhau khiến những cơ hội rõ rệt của đối thủ rất ít. Ngay cả khi HLV Benitez có những điều chỉnh như tung <a class="TextlinkBaiviet" href="http://www.24h.com.vn/su-kien/james-rodriguez/" style="color: rgb(0, 0, 255);">James Rodriguez</a>, Kovacic, Carvajal vào sân, lối chơi tấn công của “Kền kền trắng” cũng không sáng sủa hơn được là bao.</p><p style="font-family: Arial, Helvetica, sans-serif; font-size: 12px; color: rgb(0, 0, 0); line-height: normal; text-align: justify;">Hòa thất vọng không bàn thắng trong ngày khai mạc mùa giải, Real hứa hẹn sẽ có một mùa giải khó khăn trong việc cạnh tranh chức vô địch với <a class="TextlinkBaiviet" href="http://www.24h.com.vn/su-kien/barca/" style="color: rgb(0, 0, 255);">Barca</a> hay Atletico. Còn Gijon, 1 điểm trước Real quả là món quà quý giá dành tặng cho các CĐV nhà.</p><p style="font-family: Arial, Helvetica, sans-serif; font-size: 12px; color: rgb(0, 0, 0); line-height: normal; text-align: justify;"><strong>Chung cuộc</strong>: <u>Gijon 0-0 Real</u></p>', '                \r\n                \r\n                \r\n                \r\n                \r\n                ', '/images/pages/2y10j5eFlH54DTzvAlls96yKukbaCPErzbyZ2EiqwdlAVDI0t4GD0PC.png', 31, 'en', '2015-08-24 02:48:07', '2015-08-23 19:48:07', NULL);
