(17, 'MU - Newcastle: Hàng công tệ hại', 'video-ket-qua-mu-vs-newcastle', '<p style="font-family: Arial, Helvetica, sans-serif; font-size: 12px; color: rgb(0, 0, 0); line-height: normal; text-align: justify;">uy nhiên Newcastle chẳng mất nhiều thời gian để phản đòn. Đỉnh điểm là cú đánh đầu đưa bóng dội xà ngang của tiền đạo&nbsp;Mitrovic.</p><p style="font-family: Arial, Helvetica, sans-serif; font-size: 12px; color: rgb(0, 0, 0); line-height: normal; text-align: justify;">2 đội tiếp tục bắn phá khung thành của nhau trong những phút còn lại nhưng vẫn chưa có bàn thắng nào được ghi.</p><p style="font-family: Arial, Helvetica, sans-serif; font-size: 12px; color: rgb(0, 0, 0); line-height: normal; text-align: justify;">"Quỷ đỏ" là &nbsp;đội&nbsp;chơi lấn lướt hơn trong hiệp 2 trong khi "Chích chòe" cũng kiên cường chống đỡ. Ở những phút bù giờ cuối cùng, MU lẫn Newcastle đều rất gần với việc ghi bàn nhưng vận may đều ngoảnh mặt với cả 2.</p><p style="font-family: Arial, Helvetica, sans-serif; font-size: 12px; color: rgb(0, 0, 0); line-height: normal; text-align: justify;"><strong>Chung cuộc:&nbsp;</strong><u>MU 0-0 Newcastle</u></p><p style="font-family: Arial, Helvetica, sans-serif; font-size: 12px; color: rgb(0, 0, 0); line-height: normal; text-align: justify;"><strong>Đội hình xuất phát:</strong></p><p style="text-align: center; font-family: Arial, Helvetica, sans-serif; font-size: 12px; color: rgb(0, 0, 0); line-height: normal;"><img src="data:image/png;base64," data-filename="devided products manage.png" style="width: 25%;"><strong><br></strong></p><p style="font-family: Arial, Helvetica, sans-serif; font-size: 12px; color: rgb(0, 0, 0); line-height: normal; text-align: justify;">MU: Romero; Darmian, Smalling, Blind, Shaw; Schneiderlin, Schweinsteiger; Mata, Januzaj, Memphis; Rooney.</p><p style="font-family: Arial, Helvetica, sans-serif; font-size: 12px; color: rgb(0, 0, 0); line-height: normal; text-align: justify;">Newcastle:&nbsp;Krul, Mbemba, Taylor, Colocci