(18, 'the Southeast Asian country', 'the-Southeast-Asian-country', '<p style="margin-bottom: 0px; padding: 7px 0px; border: 0px; outline: 0px; font-size: 15px; vertical-align: baseline; color: rgb(51, 51, 51); line-height: 22px; font-family: Arial, Helvetica, sans-serif; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;">In the same period last year, the Southeast Asian country, whose exports rely greatly on crude oil, earned more than $5.04 billion from shipment of 5.9 million metric tons.</p><p style="margin-bottom: 0px; padding: 7px 0px; border: 0px; outline: 0px; font-size: 15px; vertical-align: baseline; color: rgb(51, 51, 51); line-height: 22px; font-family: Arial, Helvetica, sans-serif; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;">In the same period last year, the Southeast Asian country, whose exports rely greatly on crude oil, earned more than $5.04 billion from shipment of 5.9 million metric tons.</p><p style="margin-bottom: 0px; padding: 7px 0px; border: 0px; outline: 0px; font-size: 15px; vertical-align: baseline; color: rgb(51, 51, 51); line-height: 22px; font-family: Arial, Helvetica, sans-serif; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;">In the same period last year, the Southeast Asian country, whose exports rely greatly on crude oil, earned more than $5.04 billion from shipment of 5.9 million metric tons.<br></p><p style="margin-bottom: 0px; padding: 7px 0px; border: 0px; outline: 0px; font-size: 15px; vertical-align: baseline; color: rgb(51, 51, 51); line-height: 22px; font-family: Arial, Helvetica, sans-serif; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;">The slumping oil prices on the global market are the obvious culprit for the loss of the Vietnam’s oil exporting sector.</p><p style="margin-bottom: 0px; padding: 7px 0px; border: 0px; outline: 0px; font-size: 15px; vertical-align: baseline; color: rgb(51, 51, 51); line-height: 22px; font-family: Arial, Helvetica, sans-serif; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;">U.S. oil prices traded below $40 a barrel, ending 2 percent lower on Friday on signs of U.S. oversupply and weak Chinese manufacturing and notching the longest weekly losing streak in almost three decades.</p><p style="margin-bottom: 0px; padding: 7px 0px; border: 0px; outline: 0px; font-size: 15px; vertical-align: baseline; color: rgb(51, 51, 51); line-height: 22px; font-family: Arial, Helvetica, sans-serif; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;">U.S. crude on Friday dipped below the $40 threshold for the first time since the 2009 financial crisis,&nbsp;<em style="margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent;">Reuters</em>&nbsp;reported on Saturday.</p><p style="margin-bottom: 0px; padding: 7px 0px; border: 0px; outline: 0px; font-size: 15px; vertical-align: baseline; color: rgb(51, 51, 51); line-height: 22px; font-family: Arial, Helvetica, sans-serif; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;">In the same period last year, the Southeast Asian country, whose exports rely greatly on crude oil, earned more than $5.04 billion from shipment of 5.9 million metric tons.</p><p style="margin-bottom: 0px; padding: 7px 0px; border: 0px; outline: 0px; font-size: 15px; vertical-align: baseline; color: rgb(51, 51, 51); line-height: 22px; font-family: Arial, Helvetica, sans-serif; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;">In the same period last year, the Southeast Asian country, whose exports rely greatly on crude oil, earned more than $5.04 billion from shipment of 5.9 million metric tons.<br></p><p style="margin-bottom: 0px; padding: 7px 0px; border: 0px; outline: 0px; font-size: 15px; vertical-align: baseline; color: rgb(51, 51, 51); line-height: 22px; font-family: Arial, Helvetica, sans-serif; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;">Brent oil ended $1.16, or 2.5 percent, lower at $45.46 a barrel. It hit a low of $45.07 and threatened to break below $45 a barrel for the first time since March 2009, according to&nbsp;<em style="margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent;">Reuters</em>.<img src="data:image/jpeg;base64," data-filename="best framework.jpg" style="width: 25%;"></p>', ' Tuy nhiên Newcastle chẳng mất nhiều thời gian để phản đòn. Đỉnh điểm là cú đánh đầu đưa bóng dội xà ngang của tiền đạo Mitrovic. 2 đội tiếp tục bắn phá khung thành của nhau trong những phút còn lại nhưng vẫn chưa có bàn thắng nào được ghi.\r\n                \r\n                \r\n                \r\n                \r\n                ', '/images/pages/2y109XXI9rjn3hvC735nj3LQVOrl4TWag9zswqU3ZT4IazzJkg3PSV56.png', 40, 'en', '2015-08-25 02:56:30', '2015-08-24 19:56:30', NULL);

